import React,{useState,useEffect} from 'react';
//import Link from React-Router
import {Link} from 'react-router-dom';
//import NavLinksBaR 
import NavBarLinks from './NavBarLinks';

export default function Navbar(){
    //window Resize event 
    const[screenWidth,setScreenWidth]=useState(window.innerWidth) 
    useEffect(()=>{
        function handleResize(){
            setScreenWidth(window.innerWidth)
        }
        window.addEventListener('resize',handleResize)
    },[])


    return(
        <header id="header" class="u-header u-header--abs-top-md ">

        <div className='u-header u-header--abs-top-md '>
            <div className='container'>
            <nav className='js-mega-menu navbar navbar-expand-md u-header__navbar d-flex justify-content-between hs-menu-initialized hs-menu-horizontal'>

                <Link to='/' className='navbar-brand u-header__navbar-brand u-header__navbar-brand-top-space sw-header__navbar-brand'>
                <img src="https://www.saleswhale.com/hubfs/humpback/web/assets/svg/logos/sw-logo.svg" alt="Saleswhale logo"/>
                </Link>

                <NavBarLinks/>

            </nav>
            </div>
        </div>
    </header>
    )
}
